import React from "react"
import { Form, Input, Button } from 'antd';

const PostBike = () => {
    return (
        <div>
            <Input placeHolder="Year"/>
            <Input placeHolder="Make"/>
            <Input placeHolder="Model"/>
            <Button type="default">Add Bike</Button>
        </div>
    )
}

export default PostBike
